drop database if exists warehouse2;
create schema warehouse2;
use warehouse2;

create table Category (
	Category_ID INT,
	Cate_Name VARCHAR(11),
	Description VARCHAR(4)
);

create table Customer (
	Customer_ID INT,
	CustName VARCHAR(26),
	phone VARCHAR(50),
	Address VARCHAR(50),
	City VARCHAR(9),
	PostalCode VARCHAR(50)
);

create table Orders (
	Order_ID INT,
	ProductID INT,
	CustomerID INT,
	TimeID INT,
	Qty INT
);

create table Product (
	Product_ID INT,
	Name VARCHAR(42),
	Category_ID INT,
	Rate INT,
	Stock INT
);

create table Time (
	Time_ID INT,
	Date INT,
	Month VARCHAR(9),
	Year INT,
	Time VARCHAR(50)
);

